These women deserve their own post ❤
This season marks the 40th, (I'm pretty sure but lost count...🤦‍♀️) I've been involved in NY Fashion Week. I started out many years ago on the CND team, advanced to leading teams for them, then to organizing, building and leading teams for Dashing Diva (where I remember doing 20 plus shows a season 🤯), to starting my own brand where I do every aspect behind the scenes and on the scene for my brand @pattieyankeeproducts

In all the years and seasons I've been doing shows, I've never had as amazing of a team as I've built over the past few years. I gathered together anyone available at the end of the pandemic... and the core of this group has been with me ever since, giving their all with a "we got this" attitude every single show of every single season they have worked. 

They work hard and tirelessly, they take turns carrying Bessie, (the huge heavy suitcase we've affectionately named), they show up excited and read to work,, they go the extra mile to get press ons made if needed for shows, make videos and take photos for me, and have built a reputation backstage for their great personalities.

My brand, Pattie Yankee Products, is still growing and building. Each season it gets more recognition, but that could never happen without the support of these wonderful women! Words can not express the love and gratitude I have for my team. At this point they are family and I'm humbled and blessed to have each one of them in my life and to have them by my side. 

I'm so thankful for all of you and appreciate you immensely!! ❤❤ #core4plus1 #teampyp #bestteam

